import React, { Component } from 'react';
import { Navbar, Nav, NavLink, UncontrolledDropdown, DropdownItem, DropdownToggle, DropdownMenu, NavItem, Collapse, NavbarBrand, NavbarToggler } from 'reactstrap';
import { Link } from 'react-router-dom';
import Logo from './grc-logo.svg';
import './Navbar.scss';

export default class Navigation extends Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div>
        <Navbar color="light-blue" light expand="md" fixed="top">
          <NavbarBrand href="/"><img className="logo" src={Logo} alt="grclogo"/></NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/">Home</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="/about">About</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar >
                <DropdownToggle nav caret >
                  Services
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem href="/fire-protection">
                    Fire Protection
                  </DropdownItem>
                  <DropdownItem>
                    Earthquake
                  </DropdownItem>
                  <DropdownItem divider />
                  <DropdownItem>
                    Web Development
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
              <NavItem>
                <NavLink href="/contact">Contact</NavLink>
              </NavItem>
            </Nav>
          </Collapse>
        </Navbar>
      </div>
    )
  }
}
